function onKeyPress(evt) {
    var self = this
    if(evt.keyCode==116){
        if(this.gameState==0 && this.bird!==null){
            this.start()
            if(self.flap!==undefined)
                this.birdInterval = Global.setInterval(function(){self.flap()},100)
